window.bookSummaryJSON = "<p><b>Contains books 5-8 of the sci-fi survival horror series Reality Bleed, written by best-selling authors J.Z. Foster and Justin M. Woodward.</b></p> <p><b><i>The Fall of Man</i></b><b>, Book 5</b></p> <p>Hail the New Age.</p> <p>Hail the New God.</p> <p>Hail the Fall of Man.</p> <p>It's been five years since the Mars Felicity incident, and the Cold War has only gotten worse. As countries venture forth to try and gain an edge in the global struggle, accidents are sometimes made…and new enemies appear.</p> <p><b><i>World at War</i></b><b>, Book 6</b></p> <p>The World has gone to War.</p> <p>The world has been a tinder box for years—all it needed was a match.</p> <p>Now it burns.</p> <p>As armies form up, and march, is there still time to face up against the enemies from beyond our world?</p> <p><b><i>Hold the Line</i></b><b>, Book 7 </b></p> <p>The world may soon be lost…</p> <p>America watches with a growing anxiety as one-by-one the countries begin to fall. Old grudges now look petty in the face of the walking plague of alien beings hell bent on extermination.</p> <p>It might be the end of all unless new alliances can form and <i>Hold the Line</i>.</p> <p><b><i>Earth Siege</i></b><b>, Book 8</b></p> <p>War comes home…</p> <p>The alien invaders have spread across the entire globe, and the bloodiest battles have yet to happen. As humanity struggles to adapt to an ever changing enemy, what extent will they plunge into in order to survive?</p> <p>How much must the world give up in order to win? </p>"; 
